import { Box } from "@mui/system";
import React from "react";

function Login(){
    return(
        <Box sx={{
            display: "grid",
            gap: "0",
            width:"100%",
            height:"100%",
            margin: "50px auto",
            gridTemplateAreas: `"imagePart loginPart"`,

            gridTemplateColumns: {md : "3fr 4fr" , xs: '0fr 1fr'}
           }}>
                <Box sx={{ gridArea: 'imagePart' , border:1 ,display:{md : 'block' , xs:'none'}}}>
                    <Box component="img" src="img/login.png" width="100%" height="800px"></Box>
                </Box>
                <Box sx={{ gridArea: 'loginPart', border:1}}> Box</Box>
        </Box>

    );
}

export default Login;
